PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?superclass ?superclass2 
WHERE {
  <http://rdf.rhea-db.org/GenericPolypeptide> rdfs:subClassOf ?superclass .
  ?superclass rdfs:subClassOf ?superclass2 .
}

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT ?superclass ?superclass2 WHERE {
  <http://rdf.rhea-db.org/GenericPolynucleotide> rdfs:subClassOf ?superclass .
  ?superclass rdfs:subClassOf ?superclass2 .
}
